import React, { Component } from 'react';

const iframeStyle = {
    margin: '1em',
    border: 0,
}

class Schedule extends Component {
  render() {
    return (
        <div class="content">
            <h1> Hand-In-Hand Schedule </h1>
            <iframe src="https://calendar.google.com/calendar/b/2/embed?height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;ctz=America%2FLos_Angeles&amp;src=aGFuZGluaGFuZHNhZmV0eXRyYWluaW5nQGdtYWlsLmNvbQ&amp;src=YWRkcmVzc2Jvb2sjY29udGFjdHNAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;src=ZW4udXNhI2hvbGlkYXlAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;color=%23039BE5&amp;color=%2333B679&amp;color=%230B8043&amp;showTitle=0&amp;showNav=1&amp;showPrint=0&amp;showCalendars=1&amp;showTz=0" style={iframeStyle} width="800" height="580" frameborder="0" scrolling="yes"></iframe>
        {/*<a target="_blank" href="https://calendar.google.com/event?action=TEMPLATE&amp;tmeid=MTA5cm44MXBudDNpZjIwOGNxZjFrOGJjMHQgaGFuZGluaGFuZHNhZmV0eXRyYWluaW5nQG0&amp;tmsrc=handinhandsafetytraining%40gmail.com"><img border="0" src="https://www.google.com/calendar/images/ext/gc_button1_en.gif"/></a>*/} 
        </div>
    );
  }
}

export default Schedule;
